function Myform() {
  return (
    <div>
      <h1>This is my react form </h1>
      <form>
        <input type="text" placeholder="Enter your name" />
        <br />
        <br />
        <input type="text" placeholder="Enter your mail" />
      </form>
    </div>
  );
}
export default Myform;
